import styled from 'styled-components';

export const Div = styled.div`
  flex: 0 0 100%;
`

export const Button = styled.button`
  height: 64px;
  width: 64px;
  padding: 8px 16px;
  color: black;
  transition: background-color .3s;
  &:hover {background-color: #ddd}
`
